const Elements = ({ props }) => {
  const imageSrc = props.className;
  return (
    <ul id="concepts">
      <li className="concept">
        <img src={props.imageSrc} alt="{props.item[0].image}" />
        <h2>{props.item[0].title}</h2>
        <p>{props.item[0].description}</p>
      </li>
    </ul>
  );
};
export default Elements;
